import React from 'react';
import data from "../response.json"

export default (props) => {

    let { data } = props
    console.log(data)
    return (
        <div>
            {
                data && <div>
                    <ul className="center">
                        {
                            data.children.map((item, index) => {
                                return (
                                    <li> {item.name} ({item.path})</li>
                                )
                            })
                        }
                    </ul>
                </div>
            }

            <style jsx>{`
        
        .center{
            justify-content: space-around;
        }
        ul{
          padding: 0px;
        }
        li{
          list-style-type: none;
          margin-bottom: 20px;
        }
        a{
          text-decoration: none;
          color: black;
        }
        
      `}</style>
        </div>
    )
}
